import React from 'react';
import './App.css';



class App extends React.Component {
  render() {
    return (
      <div className="App">
      <table>
        <tr>
          <td>
            <a herf="/employees">Employee Changes</a>
          </td>
          <td>
            <a herf="/createEmployee">Add Employee</a>
          </td>
        </tr>
      </table>
      </div>
    );
  }
}

export default App;
